import React, { useState, useEffect } from 'react';
import { TrendingUp, DollarSign, Users, Clock, ChevronRight } from 'lucide-react';
import './CareerPaths.css';

const CareerPaths = () => {
  const [careerPaths, setCareerPaths] = useState([]);
  const [filteredPaths, setFilteredPaths] = useState([]);
  const [filters, setFilters] = useState({
    industry: '',
    experience: '',
    salary: ''
  });

  useEffect(() => {
    const savedResults = localStorage.getItem('assessmentResults');
    if (savedResults) {
      const data = JSON.parse(savedResults);
      setCareerPaths(data.recommendations);
      setFilteredPaths(data.recommendations);
    }
  }, []);

  const applyFilters = () => {
    let filtered = careerPaths;

    if (filters.industry) {
      filtered = filtered.filter(path => path.industry === filters.industry);
    }
    if (filters.experience) {
      filtered = filtered.filter(path => path.experienceLevel === filters.experience);
    }
    if (filters.salary) {
      filtered = filtered.filter(path => {
        const salary = parseInt(path.avgSalary.replace(/[^0-9]/g, ''));
        const filterSalary = parseInt(filters.salary);
        return salary >= filterSalary;
      });
    }

    setFilteredPaths(filtered);
  };

  useEffect(() => {
    applyFilters();
  }, [filters, careerPaths]);

  return (
    <div className="career-paths">
      <div className="container">
        <div className="page-header">
          <h1>Career Path Recommendations</h1>
          <p>Explore personalized career paths based on your assessment</p>
        </div>

        <div className="filters-section">
          <div className="filter-controls">
            <select 
              value={filters.industry} 
              onChange={(e) => setFilters({...filters, industry: e.target.value})}
            >
              <option value="">All Industries</option>
              <option value="technology">Technology</option>
              <option value="healthcare">Healthcare</option>
              <option value="finance">Finance</option>
              <option value="education">Education</option>
            </select>
            <select 
              value={filters.experience} 
              onChange={(e) => setFilters({...filters, experience: e.target.value})}
            >
              <option value="">All Experience Levels</option>
              <option value="entry">Entry Level</option>
              <option value="mid">Mid Level</option>
              <option value="senior">Senior Level</option>
            </select>
            <select 
              value={filters.salary} 
              onChange={(e) => setFilters({...filters, salary: e.target.value})}
            >
              <option value="">All Salary Ranges</option>
              <option value="50000">$50,000+</option>
              <option value="75000">$75,000+</option>
              <option value="100000">$100,000+</option>
            </select>
          </div>
        </div>

        <div className="career-paths-grid">
          {filteredPaths.map((path, index) => (
            <div key={index} className="career-path-card">
              <div className="path-header">
                <h3>{path.title}</h3>
                <span className="match-score">{path.matchScore}% Match</span>
              </div>
              <p className="path-description">{path.description}</p>

              <div className="path-stats">
                <div className="stat-item">
                  <DollarSign size={16} />
                  <span>{path.avgSalary}</span>
                </div>
                <div className="stat-item">
                  <TrendingUp size={16} />
                  <span>{path.growthRate}</span>
                </div>
                <div className="stat-item">
                  <Users size={16} />
                  <span>{path.jobOpenings} openings</span>
                </div>
                <div className="stat-item">
                  <Clock size={16} />
                  <span>{path.timeToAdvance}</span>
                </div>
              </div>

              <div className="required-skills">
                <h4>Required Skills:</h4>
                <div className="skills-list">
                  {path.requiredSkills.map(skill => (
                    <span key={skill} className="skill-tag">{skill}</span>
                  ))}
                </div>
              </div>

              <div className="path-actions">
                <button className="btn btn-primary">
                  View Details
                  <ChevronRight size={16} />
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CareerPaths;
